import React, { Component } from "react";
import { Popover } from "@material-ui/core";

export class Showmoreoption extends Component {
  render() {
    return (
      <div>

        <Popover
          anchorReference="anchorPosition"
          anchorPosition={{ top: 200, left: 700 }}
          anchorOrigin={{
            vertical: "top",
            horizontal: "left"
          }}
          transformOrigin={{
            vertical: "top",
            horizontal: "left"
          }}
        >
          The content of the Popover.
        </Popover>
      </div>
    );
  }
}

export default Showmoreoption;
